import { Route, BrowserRouter } from 'react-router-dom';
import Home from 'pages/home';
import Login from 'pages/Login';

const Routes = () => {
    return (
        <BrowserRouter>
            <Route Component={Home} path="/"  />
            <Route Component={Login} path="/Login" />
        </BrowserRouter>
    )
}

export default Routes;
